import './App.css';
import { useParams,useRouteMatch } from 'react-router-dom';


const ProductPage = ({match}) => {
    const product = data.find(product => {
        return match.params.id === product.id;
    })

    return <>
        {match.isExact && <>
            <p></p>
        </>}    
